'''Bandit Duty Free''', owned by [[Noterazzo]], is a [[general store]] located in the [[Bandit Camp (Wilderness)|Wilderness Bandit Camp]]. It is one of four to buy items at a higher cost than the normal general store cost, the other three being [[Martin Thwait's Lost and Found]], [[West Ardougne General Store]], and [[Pollnivneach general store.|Pollnivneach General Store]]; on empty stock, both the West Ardougne General Store and the Pollnivneach General Store will buy at 55% of [[item value]] while the other two buy at 60%, the same as [[High Level Alchemy]] value.

If players ask [[Noterazzo]] about his store buying at high prices, he will explain that he can do so because the tax collector does not come to his store due to its dangerous location.

'''{{Colour|red|Warning}}:''' As the lowest price this store buys items for is identical to every other shop, it is not recommended to sell items in bulk at this location due to the risk of getting attacked.

